script: |
  super -f text -I q4697.spq | sort > q4697.out

inputs:
  - name: q4697.spq
    data: |
      SELECT col2 * tab0.col1 * + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - col2 ) BETWEEN col2 + + col0 AND col1;
  - name: tab0

outputs:
  - name: q4697.out
    data: |
      3395
      664118
      68112
